DB_RAW = "\"FEB130001\"\t\"PREVIEWS #295 APRIL 2013 (Net)\"\t4.50\t\"Since 1988, PREVIEWS has been your ultimate source for all of the comics and merchandise to be available from your local comic book shop\x85 revealed up to two months in advance! Hundreds of comics and graphic novels from the best comic publishers; the coolest pop-culture merchandise on Earth; plus PREVIEWS exclusive items available nowhere else! Now more than ever, PREVIEWS is there to show the tales, toys and treasures in your future! The April issue features items scheduled to ship in June 2013 and beyond.\"\t\"\"\r\n\"FEB130002\"\t\"MARVEL PREVIEWS APRIL 2013 EXTRAS (Net)\"\t1.25\t\"Each issue of Marvel Previews is a comic book-sized, 120-page, full-color guide and preview to all of Marvel's upcoming releases - it's your #1 source for advanced information on Marvel Comics! This April issue features items scheduled to ship in June 2013 and beyond.\"\t\"\"\r\n\"FEB130003\"\t\"PREVIEWS #295 APRIL 2013 CUSTOMER ORDER FORM (Net)\"\t.00\t\"PREVIEWS makes it easy for you to order every item in the catalog with this separate order form booklet! This April issue features items scheduled to ship in June 2013 and beyond.\"\t\"\"\r\n\"FEB130004\"\t\"PREVIEWS #295 APRIL 2013 CUSTOMER ORDER FORM EXTRAS (Net)\"\t.00\t\"PREVIEWS makes it easy for you to order every item in the catalog with this separate order form booklet! This April issue features items scheduled to ship in June 2013 and beyond.\"\t\"\"\r\n\"FEB130005\"\t\"PREVIEWS #295 APR 2013 RET ORD FORM FREE EXTRAS (LIM 1) (Net)\"\t.00\t\"Retailer Order Form.\"\t\"\"\r\n\"FEB130006\"\t\"PREVIEWS #295 APR 2013 RETAILER ORDER FORM EXTRAS (Net)\"\t.00\t\"Retailer Order Form.\"\t\"\"\r\n\"FEB130007\"\t\"PREVIEWS #295 APRIL 2013 FAX ORDER FORM (LIMIT 1) (Net)\"\t.00\t\"Fax Order Form.\"\t"
